INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '<ul>\r\n<li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\r\n<li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\r\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2015-05-08 03:19:44', '2015-05-23 03:48:22', 0),
(2, 'Footer Links Company', 'footer_links_company', '<div class="links">\r\n<div class="block-title"><strong><span>Company</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\r\n<li><a href="{{store url=""}}contacts/">Contact Us</a></li>\r\n<li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\r\n<li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\r\n</ul>\r\n</div>', '2015-05-08 03:19:45', '2015-05-23 03:48:31', 0),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2015-05-08 03:19:45', '2015-05-08 03:19:45', 1),
(4, 'Em0120 - Area 01 - Shipping', 'em0120_area01_shipping', '<div class="col-sm-8 first">\r\n<div class="content first "><img title="entrega" src="{{media url="wysiwyg/delivery.png"}}" alt="entrega" />\r\n<h3>Frete Gr&aacute;tis</h3>\r\n<p>nas compras acima de R$300,00</p>\r\n</div>\r\n</div>\r\n<div class="col-sm-9">\r\n<div class="content second"><img title="pagamento" src="{{media url="wysiwyg/pagamento_banner.png"}}" alt="pagamento" />\r\n<h3>At&eacute; 4x sem juros com Pagseguro</h3>\r\n<p>parcela m&iacute;nima de R$50,00</p>\r\n</div>\r\n</div>\r\n<div class="col-sm-7 last">\r\n<div class="content last "><img title="certificado" src="{{media url="wysiwyg/certificado_banner.png"}}" alt="certificado" />\r\n<h3>Garantia de 1 ano</h3>\r\n<p>em todas as pe&ccedil;as da loja virtual</p>\r\n</div>\r\n</div>', '2015-05-08 05:14:04', '2015-09-12 02:37:32', 1),
(5, 'Em0120 - Area 05 - Features', 'em0120_area05_features', '<div class="col-sm-8 first">\r\n<div class="feature-content">\r\n<h3>Style for every budget at CD!</h3>\r\n<p>Open source policymakers; crisis management legal aid, recognize potential investment action refugee research. Underprivileged Oxfam</p>\r\n</div>\r\n<div class="feature-content">\r\n<h3>Clean design</h3>\r\n<p>Honesty medicine theory of social change, protect, involvement eradicate fluctuation sustainable future collaborative. Celebrate Jane Jacobs</p>\r\n</div>\r\n</div>\r\n<div class="col-sm-8">\r\n<div class="feature-content">\r\n<h3>Loaded With Power</h3>\r\n<p>Global health humanitarian relief human potential; catalyst small-scale farmers maintain opportunity combat poverty.</p>\r\n</div>\r\n<div class="feature-content">\r\n<h3>Choose the products you love</h3>\r\n<p>Celebrate Jane Jacobs, economic security resolve storytelling human experience. Equal opportunity socio-economic divide Arab</p>\r\n</div>\r\n</div>\r\n<div class="col-sm-8 last">\r\n<div class="feature-content">\r\n<h3>Completely Customizable</h3>\r\n<p>Cross-agency coordination crowdsourcing sanitation Action Against Hunger affiliate reproductive rights. Nonprofit, shift initiative diversity</p>\r\n</div>\r\n<div class="feature-content">\r\n<h3>Free Updates &amp; Support</h3>\r\n<p>Achieve Gandhi public sector human potential lore healthcare non-partisan forward-thinking innovation crowdsourcing equal</p>\r\n</div>\r\n</div>', '2015-05-08 05:14:04', '2015-05-15 02:42:58', 0),
(6, 'Em0120 - Area 05 - Three Banners', 'em0120_area05_three_banners', '<ul>\r\n<li class="col-sm-6 first"><a href="#"><img title="Mini banner 1" src="{{media url="wysiwyg/banner_mini1.jpg"}}" alt="Mini banner  1" /><span><span>Lorem Ipsum</span></span></a>\r\n<div class="mask">&nbsp;</div>\r\n</li>\r\n<li class="col-sm-6"><a href="#"><img title="Mini banner 2" src="{{media url="wysiwyg/banner_mini2.jpg"}}" alt="Mini banner 2" /><span><span>Lorem Ipsum</span></span> </a>\r\n<div class="mask">&nbsp;</div>\r\n</li>\r\n<li class="col-sm-6"><a href="#"><img title="Mini banner 3" src="{{media url="wysiwyg/banner_mini3.jpg"}}" alt="Mini banner 3" /><span><span>Lorem Ipsum</span></span></a>\r\n<div class="mask">&nbsp;</div>\r\n</li>\r\n<li class="col-sm-6 last"><a href="#"><img title="Mini banner 4" src="{{media url="wysiwyg/banner_mini4.jpg"}}" alt="Mini banner 4" /><span><span>Lorem Ipsum</span></span></a>\r\n<div class="mask">&nbsp;</div>\r\n</li>\r\n</ul>', '2015-05-08 05:14:04', '2015-05-19 05:17:49', 1),
(7, 'Em0120 - Area 06 - Banner Shipping', 'em0120_area06_banner_shipping', '<p><span class="icon slide">icon</span></p>\r\n<h3>LOOKING COOL <span>&amp;</span> COLLECTED</h3>\r\n<div><a class="see_more" href="#">DISCOVER</a></div>', '2015-05-08 05:14:04', '2015-09-14 21:56:23', 1),
