(1, 'Página Não Encontrada', 'two_columns_left', 'Page keywords', 'Page description', 'no-route', NULL, '<div class="page-title"><h1>Whoops, desculpe-nos...</h1></div>\r\n<dl>\r\n    <dt>A página solicitada não foi encontrada, e temos alguns possíveis motivos:</dt>\r\n    <dd>\r\n        <ul class="disc">\r\n            <li>Se você digitou a URL diretamente, por favor, certifique-se que a grafia está correta.</li>\r\n            <li>Se você clicou em um link para chegar até aqui, o link provavelmente está desatualizado.</li>\r\n        </ul>\r\n    </dd>\r\n</dl>\r\n<dl>\r\n    <dt>O que você pode fazer?</dt>\r\n    <dd>Fique tranquilo, a ajuda está próxima! </dd>\r\n    <dd>Existem algumas maneiras para retornar para a loja virtual:</dd>\r\n    <dd>\r\n<br />\r\n        <ul class="disc">\r\n            <li><a href="#" onclick="history.go(-1); return false;">- Clicar aqui e retornar para a página anterior.</a> </li>\r\n            <li>- Usar a caixa de busca e procurar por seus produtos</li>\r\n            <li>- Clicar em um dos links abaixo:<br /><br /><a href="{{store url=""}}">Home da Loja</a>\r\n            <span class="separator">|</span> <a href="{{store url="customer/account"}}">Minha conta</a></li>\r\n        </ul>\r\n    </dd>\r\n</dl>\r\n', '2015-05-08 03:19:44', '2015-06-06 02:53:34', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Home page', 'two_columns_right', NULL, NULL, 'home', NULL, '<div class="page-title"><h2>Home Page</h2></div>', '2015-05-08 03:19:44', '2015-05-08 03:19:47', 1, 0, '<!--<reference name="content">\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\n            <action method="addPriceBlockType">\n                <type>bundle</type>\n                <block>bundle/catalog_product_price</block>\n                <template>bundle/catalog/product/price.phtml</template>\n            </action>\n        </block>\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\n            <action method="addPriceBlockType">\n                <type>bundle</type>\n                <block>bundle/catalog_product_price</block>\n                <template>bundle/catalog/product/price.phtml</template>\n            </action>\n        </block>\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\n            <action method="addPriceBlockType">\n                <type>bundle</type>\n                <block>bundle/catalog_product_price</block>\n                <template>bundle/catalog/product/price.phtml</template>\n            </action>\n        </block>\n    </reference>\n    <reference name="right">\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
