(10, 'Contato', 'two_columns_left', NULL, NULL, 'contato', NULL, '\r\n\r\n<div class="contact-form">\r\n	<p>Para dúvidas sobre uma compra ou mais informações sobre nossos produtos, por favor preencha o formulário abaixo para que possamos atendê-lo:\r\n</p>\r\n	<form action="">\r\n		<ul>\r\n			<li><label>Nome<span> *</span></label><input type="text" name="nome"></li>\r\n			<li><label>Sobrenome<span> *</span></label><input type="text" name="sobrenome"></li>\r\n			<li><label>Email<span> *</span></label><input type="text" name="email"></li>\r\n			<li><label>Telefone de Contato<span> *</span></label><input class="ddd" type="text" name="ddd"><input class="tel" type="text" name="telefone"></li>\r\n			<li><label>Celular</label><input class="ddd" type="text" name="ddd"><input class="tel" type="text" name="telefone"></li>\r\n			<li><label>Tipo de Solicitação<span> *</span></label>\r\n				<select>\r\n					  <option value="sugestao">Sugestão</option>\r\n					  <option value="duvida">Dúvida</option>\r\n					  <option value="reclamacao">Reclamação</option>\r\n				</select>\r\n			</li>\r\n			<li><label>Comentários<span> *</span></label>\r\n				<textarea type="text"></textarea>\r\n			</li>\r\n			<li><button type="submit">Enviar</button></li>\r\n		</ul>\r\n	</form>\r\n</div>', '2015-06-06 01:06:21', '2015-06-06 02:31:39', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
