(14, 'Contatodois', 'one_column', NULL, NULL, 'contatodois', NULL, '<p> <select id="hider"> <option>Médico</option> <option>Mídia (jornais, revistas etc)</option> <option>Loja Física</option> <option>Profissional de Estética</option> <option>Rede Social</option>  </select> <input id="toHide" type="text" /></p>\r\n\r\n<button type="submit">Enviar</button>\r\n<script type="text/javascript" src="https://ajax.googleapis.com/ajax/libs/jquery/1.11.3/jquery.min.js"></script>\r\n<script type="text/javascript">// <![CDATA[\r\njQuery(function() {\r\n     var inputToHide = jQuery("#toHide");\r\n    jQuery(''#hider'').on(''change'', function() {\r\n         var selected = jQuery(''#hider option:selected'').val();\r\n         if ( selected === "Médico" ) {\r\n             //alert("will show");\r\n            inputToHide.show();\r\n         } else {\r\n             //alert("will hide");\r\n            inputToHide.hide();             \r\n         }\r\n     });\r\n});\r\n// ]]></script>', '2015-07-17 04:14:24', '2015-07-17 04:35:10', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(15, 'Quem Somos', 'one_column', NULL, NULL, 'quem-somos', NULL, '<p>A Lu Garcia &eacute; uma rede de lojas de semi joias e acess&oacute;rios situada no Rio de Janeiro que h&aacute; 20 anos valoriza a beleza da mulher oferecendo itens cuidadosamente selecionados.</p>\r\n<p>Queremos encantar voc&ecirc;!</p>\r\n<p>Entre e seja feliz!</p>', '2015-10-05 21:09:14', '2015-10-05 21:09:14', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
